      SELECT ALL 75 col1, + CASE + - 5 WHEN + - 2 THEN + 19 / - 61 ELSE NULL END + - 1 AS col1, + MIN ( DISTINCT - 43 ) + + CAST ( CAST ( NULL AS INTEGER ) AS INTEGER ) AS col0;

outputs:
  - name: q5304.out
    data: |
      75	NULL	NULL
